import "./todo.css";

const Todo = ()=>{
	return(
	<>
    <div className="main-div">
     <div className="child-div">
     <figure>
     <figcaption>
     Add Your List Here
     </figcaption>
      </figure>

      <div className="addItems">
       <input type="text" placeholder="Add Items.."/>
       <i className="fa fa-plus add-btn"></i>
      </div>

     </div>
    </div>

	</>
)
}

export default Todo;
